// JournalPage.js
import React from 'react';
import './JournalPage.css';

const JournalPage = ({ title, content}) => {
  return (
    <div className="journal-page">
      <h2>{title}</h2>
      <p>{content}</p>
    </div>
  );
};

export default JournalPage;
